package com.ruchij;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

class NeedleStackTest {
    private final NeedleStack needleStack = new NeedleStack();

    @Test
    void testOne() {
        Assertions.assertEquals(2, needleStack.strStr("hello", "ll"));
    }

    @Test
    void testTwo() {
        Assertions.assertEquals(-1, needleStack.strStr("aaaaa", "bba"));
    }

    @Test
    void testThree() {
        Assertions.assertEquals(0, needleStack.strStr("", ""));
    }

    @Test
    void testFour() {
        String haystack = "";
        String needle = "";
        Assertions.assertEquals(-1, needleStack.strStr(haystack, needle));
    }

}